import React from 'react'
import './logoSearch.css'
import logo from '../../img/yapooo_logo.png';

const LogoSearch = () => {
  return (
    <div className='logoSearch'>
        <img src={logo} alt="" />
    </div>
  )
}

export default LogoSearch
